import React from "react";
import { Container } from "react-bootstrap";

const About = () => {
  return (
    <Container>
      <div className="about-box">
        <div id="about">
          <div className="about-img-div">
            <div className="about-img">
              <img src="./Images/PC.jpg" className="pc img-fluid" alt="pc" />
            </div>
            <div className="about-img-ab"></div>
          </div>
          <div
            style={{ "margin-bottom": "30px" }}
            className="about-logo text-center"
          >
            <span>About me</span>
          </div>
          <div className="about-info">
            <span>
              Hello, I'm Shubham Chikhale, a recent graduate in Computer Science
              and Engineering with a keen interest in Front-end Development and
              React. I have completed several online courses and have hands-on
              experience in creating web applications using React.
            </span>
          </div>
        </div>
      </div>
    </Container>
  );
};

export default About;
